import Link from 'next/link'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSignInAlt, faHome, faUser } from '@fortawesome/free-solid-svg-icons';

const Nav = () => (
    <Navi>
        <Link href="/">
          <a><FontAwesomeIcon icon={ faSignInAlt } /></a>
        </Link>
        <Link href="/login">
            <a><FontAwesomeIcon icon={ faHome } /></a>
        </Link>
        <Link href="/user">
            <a><FontAwesomeIcon icon={ faUser } /></a>
        </Link>
        <style jsx>{`
            div {
                background: red;
            }
        `}</style>
    </Navi>
)

export default Nav
